/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = ("<ion-app>\r\n  <ion-header>\r\n    <ion-item>      \r\n      <img class=\"back-splash\"src=\"assets/imgs/caret-back-outline.svg\" routerLink=\"/menu\">\r\n      <img class=\"img-header\"src=\"assets/imgs/desenho-ariano-mini.svg\">\r\n      <img class=\"txt-header\" src=\"assets/imgs/nome-fenearte.svg\">\r\n    </ion-item>    \r\n  </ion-header>\r\n  <ion-content>\r\n      <h1>\r\n      É festa no reino da arte! \r\n     </h1>\r\n     <p>\r\n      A 21ª edição da Fenearte acontece de 10 a 19 de dezembro de 2021 no Centro de Convenções de Pernambuco. Nesse ano, a feira homenageia o Movimento Armorial idealizado por Ariano Suassuna há 51 anos. A campanha gráfica mostra figuras iconográficas dos traços de Zelia Suassuna, que este ano completa 90 anos, e destaca o cinquentenário do romance A Pedra do Reino. \r\n      A edição da feira celebra também o reconhecimento do IPHAN, por meio do prêmio Rodrigo Melo Franco, como uma iniciativa de preservação do patrimônio cultural imaterial, reconhecimento importante por valorizar e difundir os saberes tradicionais.         \r\n     </p>     \r\n      <ul>\r\n        <li>21ª Fenearte</li>\r\n        <li>De 10 a 19 de Dezembro de 2021</li>\r\n        <li>Segunda a Quinta das 14h às 22h</li>\r\n        <li>Sexta a Domingo das 10h às 22h </li>\r\n      </ul>\r\n      <h2>\r\n        Fenearte \r\n       </h2>\r\n       <p>\r\n        A Feira Nacional de Negócios do Artesanato, Fenearte, é conhecida como a maior feira de artesanato da América Latina. Durante todo o evento o público pode conferir centenas de estandes de artesãos pernambucanos, além do trabalho de artesãos de outros Estados e até mesmo internacionais. Além disso, durante a feira é possível aproveitar uma programação que inclui oficinas de artesanato, apresentações culturais, rodadas de negócio, passarela de moda, teatro infantil e muito mais.\r\n       </p>\r\n       <h2>\r\n        Movimento Armorial\r\n       </h2>\r\n       <p>\r\n        Nascido na década de 70, o Movimento Armorial surgiu com o objetivo de valorizar as artes populares nordestinas, e sua ancestralidade ibérica. Idealizado pelo escritor paraibano Ariano Suassuna, a manifestação ganhou força e foi grande inspiração em diversas expressões artísticas como literatura, música, dança, teatro, artes plásticas, arquitetura, cinema, entre outras artes. O movimento 100% brasileiro e nordestino mostrou a força da nossa arte, buscando as perspectivas do sertão nordestino e apresentando a riqueza dos nossos valores culturais e artísticos.\r\n       </p>\r\n       <h2>\r\n        Contato\r\n       </h2>\r\n       <p>\r\n        Para dúvidas ou sugestões, entre em contato com a gente.  \r\n        81 3181-3454\r\n  \r\n        <strong>\r\n          e-mail\r\n        </strong>   \r\n          <a href=\"mailto:fenearte@centrodeartesanato.pe.gov.br\">fenearte@centrodeartesanato.pe.gov.br</a>  \r\n        \r\n        Atendimento de segunda a sexta-feira das 8h às 17h\r\n       </p>\r\n    \r\n  </ion-content>\r\n  <ion-footer> \r\n       \r\n  </ion-footer>\r\n</ion-app>\r\n");

